        % pFalseAlarm(iSIR, iEta) = sumFA/sampleSize;
        % pDetection(iSIR, iEta)  = sumTD/sampleSize;

        iEta
    end
end 

pFalseAlarm = sumFA/sampleSize;
pDetection  = sumTD/sampleSize;

